export class User {
  constructor(expiration, type, user_id, value) {
    this.expiration = expiration;
    this.type = type;
    this.user_id = user_id;
    this.value = value;
  }
  get Token() {
    if (!this.expiration || new Date() > this.expiration) {
      return null;
    }
    return this.value;
  }
}
